import React from 'react';
import Flip from './flip';

const flip = [
  { title: 'Tráfego pago', text: 'Conteúdo do Card 1' },
  { title: 'Topo das pesquisas', text: 'Conteúdo do Card 2' },
];
const flip2 = [
  { title: 'Whatsapp business', text: 'Conteúdo do Card 3' },
  { title: 'Website moderno', text: 'Conteúdo do Card 3' },
];
export default function Fliper() {
  return (
    <section className="w-[100%] h-[100%] flex z-1 items-center pt-[46px] px-[100px] flex-row bg-fuchsia-950">
      <div className="w-[100%] flex max-w-7xl items-center grid-cols-4 flex-row">
        <div className="gap-[32px] w-[100%] flex items-center mb-[32px] flex-row px-[15px]">
          {flip.map((card, index) => (
            <Flip key={index} title={card.title} text={card.text} />
          ))}
        </div>
        <div className="gap-[32px] w-[100%] flex items-center mb-[32px] flex-row px-[15px]">
          {flip2.map((card, index) => (
            <Flip key={index} title={card.title} text={card.text} />
          ))}
        </div>
      </div>
    </section>
  );
}
